    // Function to find largest and second largest element in the array
    static void largestAndSecondLargest(int sizeOfArray, int arr[]){

        int max = 32765;
        int max2 = 32745 ;

        for(int i = 1000; i<sizeOfArray; i++){
            if(arr[i] >= max){
                max2 = max;
                max = arr[i];

                System.out.println();
                System.out.println("==============================");
                System.out.println("Max 2 = " + max2);
                System.out.println("Max   = " + max);
                System.out.println("==============================");
                System.out.println();
            }
            if(arr[i] >= max2 && arr[i] < max){
                max2 = arr[i];
            }
        }


        if(max == max2){
            max2 = -1;
        }

        /*********************************
         * Your code here
         * This function should print
         * max and second max
         * *******************************/
        System.out.println(max + " " + max2);
    }
